import React from "react";
import { Card } from "../Card";

const FlightCard = ({
    ident,
    departuretime,
    arrivaltime,
    readableDeparture,
    readableArrival,
    origin,
    destination 
}) => {

    return (<Card>
        <p>{ident}</p>
        <p>{departuretime}</p>
        <p>{arrivaltime}</p>
        <p>{readableDeparture}</p>
        <p>{readableArrival}</p>
        <p>{origin}</p>
        <p>{destination}</p>
    </Card>);
};

export default FlightCard;
